INSERT INTO `documentum_app_post` VALUES (15,'Suraj Prasad Gupta\r\n \r\n+91\r\n-\r\n9140097253\r\n \r\nspgupta082@gmail.com\r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\nCAREER OBJECTIVE\r\n \r\n \r\n \r\nTO work for an organization where i can prove my ability and grow with the growth of the organization \r\nand \r\nImprove my skill and realize my potential.\r\n \r\n \r\nPROFETIONAL QUALIFICATION\r\n \r\n \r\n \r\n\r\n \r\n \r\nMCA from Rajarshi School of Management & Technology\r\n \r\nVaranasi(up).\r\n \r\n\r\n \r\nComplited Bsc\r\n-\r\nIT from Makhan Lal Chaturvedi Rastriya Patrakarita University(bhopal) Graduated in \r\nJul 2016 with \r\nscore of 68\r\n \r\n%.\r\n \r\n \r\n \r\nEDUCATION QUALIFICATION\r\n \r\n \r\n \r\nClass\r\n \r\nXII\r\n \r\nUttar Pradesh board with 63.5% in\r\n \r\n2011\r\n \r\n \r\nClass\r\n \r\nX\r\n \r\nUttar Pradesh board with 69.3% in\r\n \r\n2009\r\n \r\n \r\nTechnical \r\nSKILLS\r\n \r\n \r\nComputer\r\n \r\nSkills\r\n \r\nC, Python, Django\r\n, PHP , mysql ,HTML,CSS\r\n \r\n,JavaScript\r\n \r\n \r\nLanguage\r\n \r\nEnglish ,\r\n \r\nHindi.\r\n \r\n \r\nAREA OF INTREST\r\n \r\n \r\n \r\n \r\nData Structure\r\n\r\n \r\n \r\nINTERNSHIPS\r\n \r\n \r\n \r\n \r\nFour month internship in python and Django from finsq Professionals Private Limited \r\nGurgaon\r\n \r\nin 1\r\nst\r\n \r\nmay 2019 to 31 Aug 2019 where I am working on Accounting software \r\nAkounter that contain ERP  Accounting ,HRA ,PAYROLL , CRM like modules that link \r\nis \r\nhttp://85.187.132.4\r\n.\r\n\r\n\r\n \r\nOne month web devolopement certification in PH\r\nP from HCL that is conducted by \r\nmy \r\ncollage in July 2016 where i was learn lot of technical term related to web devolopement\r\n\r\n\r\n\r\n \r\nSix month internship in a C3 Software solution in Varanasi where i worked as an\r\n \r\ninern \r\nIn August 2016 to January\r\n \r\n2016.\r\n\r\n \r\nSUMMER INTERNSHIP & PROJECT\r\n \r\n \r\nMajor Project\r\n \r\n:\r\n \r\nDuration\r\n \r\n:\r\n \r\nFront\r\n \r\nEnd\r\n \r\n:\r\n \r\n \r\n \r\nDescription\r\n \r\nTwitter Sentiment Analysis. \r\n8 week.\r\n \r\nPython\r\n \r\n \r\n\r\n\r\nthe opinion or attitude of a speake for Business,Politics,Public Action.\r\n \r\n \r\n \r\n \r\nSUMMER \r\nINTERNSHIP & PROJECT (in MCA)\r\n \r\n \r\nMinor\r\n \r\nproject\r\n \r\n:\r\n \r\nFlight Reservation System\r\n \r\nDuration\r\n \r\n:\r\n \r\nFour\r\n \r\nweek\r\n \r\nFront\r\n \r\nEnd\r\n \r\n:\r\n \r\nphp\r\n \r\nBack End\r\n \r\n:\r\n \r\nMy\r\n \r\nSql\r\n \r\n \r\nDescription\r\n \r\n \r\nAirline Reservation System is a web application which help the use to book airline tickets from \r\nVarious alternati\r\nves knowing there complete information like source ,destination fare,time, and \r\nSeats availability. For the application to work, the admin and user has to Login with user name \r\nand password . various module of project is:\r\n \r\n \r\n1.\r\n \r\nLogin\r\n \r\n2. Home\r\n \r\n3. Flight type\r\n \r\n2.\r\n \r\nContact\r\n-\r\nus\r\n \r\n5. Print Ticket\r\n \r\n6. Admin CMS\r\n \r\n \r\n \r\nPERSENAL DETRAIL\r\n \r\n \r\n\r\n \r\nName:\r\n \r\nSuresh Prasad Gupta\r\n \r\nDate Of\r\n \r\nBirth  :\r\n \r\n4 July\r\n \r\n1994\r\n \r\nNationality\r\n \r\n:\r\n \r\nIndian\r\n \r\nLocation\r\n \r\n:\r\n \r\nVaranasi\r\n \r\nSex\r\n \r\n:\r\n \r\nMale\r\n \r\nMarital\r\n \r\nstatus \r\n \r\n:\r\n \r\nUnmarried\r\n \r\nHobbies\r\n \r\n:\r\n \r\nListening music & not trust \r\nanyone easly without knowing \r\nthem .\r\n \r\nDeclaration\r\n \r\nI here by declare that above information is true to the best of my knowledge and any fault in \r\nabove details, i am fully responsible for it.\r\n \r\n \r\nDate\r\n \r\n..................\r\n \r\nSignature\r\n \r\nSuraj \r\nPrasad Gupta\r\n \r\nPlace\r\n \r\n..................\r\n \r\n(RSMT Varanasi)\r\n \r\n','2019-09-24','/media/static/upload_files/resume_1_3-converted-converted_1_KLLz2D3.pdf','suraj',NULL,''),(16,'Rahul N Rana\r\n7/7, Rail Vihar, Gurgaon – 122 003                           rahulxxx@gmail.com                                                         +91 – 96xxxxxxxx\r\n4th year B.Tech Computer Science student at IIT Madras with excellent academic record and keen interest and practical exposure in the field of information security, especially web applications security.\r\nB.Tech, Computer Science & Engineering                                                                                                                              2010-14\r\nIIT Madras, CGPA – 8.52/10\r\n\r\n12th (Senior Secondary Examination)                                                                                                                                            2010\r\nCBSE Board, 85%                 \r\n\r\n10th (Secondary Examination)                                                                                                                                                        2008  \r\nCBSE Board, 92%\r\n\r\nProgramming Languages – C, C++, Java\r\nWeb Technologies – PHP, MySQL, HTML, CSS, JavaScript\r\nWeb Development intern, XYZ Ltd.                                                                                           Jun-Jul’13\r\nWorked on the backend development of a new portal using LAMP stack & CodeIgniter framework. I wrote a crawler that would parse through a pre-defined set of web pages (~1 Mn pages a day) and insert relevant data in desired format in the portal’s database tables. \r\nReceived The Best Intern award (among 35 interns) from the CEO of the organization.\r\n\r\nResearch intern, Carnegie Melon University, USA                                                                                                               Dec’12\r\nUnderwent a 4 week fully sponsored classroom training program on research methodologies, tools & technologies. Also worked on a project in speech technology track which involved detecting key and chord in a given unfinished musical piece (used Hidden Markov Models), selecting a suitable ‘completing chord progression’ using music theory, and synthesizing the  finishing phrase.\r\n\r\nHandwritten Digit Recognition                   Aug-Dec’12\r\nAs part of B.Tech. Research Project (6th Semester, team of two), we used techniques like Otsu\'s method and a Multi-Layer Perceptron, to achieve an accuracy of 95.6% in detecting legible Handwritten Numerical Digits. I was responsible for the GUI for the application that I developed using J2SE (Java).\r\n\r\nSix weeks CEH (Certified Ethical Hacker) training & certification                                                                             Jun-Jul’12\r\nAttended a 2 days workshop on HTML5                                                                                                                             Nov’11\r\nSecured All India Rank 78 (99.9%ile) in JEE 2010                                                                                           \r\nRepresented IIT Madras in Regional Finals of ACM-ICPC in 2012 \r\nBranch Councillor for year 2012-13, responsible for training & placement activities for 120 students\r\nHave undergone 5 years of formal training in classical music (2005-10)\r\nHobbies include reading sci-fi novels, trekking, and writing.','2019-09-24','/media/static/upload_files/Internshala_resume_template1_1_2.docx','suraj',NULL,''),(17,' \r\n \r\n \r\n \r\n \r\n \r\n       \r\nINTERNSHALA RESUME GUIDE\r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\nRESUME GUIDE\r\n \r\n \r\n \r\nWhat is a resume? What is its purpose?\r\n \r\n \r\nA resume is \r\na \r\n1\r\n-\r\n2 page document that presents your skills and achievements and that you may use to market \r\nyourself. The purpose of a resume is to get you an interview call.\r\n \r\n \r\nWhat should it contain?\r\n \r\n \r\nA resume should contain short summary of your qualification, experience\r\n \r\nand other relevant details which \r\nshould help your recruiter make an assessment of your suitability for the given position.\r\n \r\n \r\nBefore you write anything on your resume just ask yourself if that information will help you get an interview call.\r\n \r\n \r\n \r\nUseful pointers:\r\n \r\n \r\n1.\r\n \r\n\r\nfollowing things should be taken care of: \r\n \r\n \r\na.\r\n \r\nAvoid sugar\r\n-\r\ncoated, vague, generic global objective statements. You know\r\n \r\n\r\nknow even better \r\n \r\n \r\nb.\r\n \r\nObjective should be \r\nvery specific\r\n \r\nand should be substantiated by the internships/projects done. \r\n \r\n \r\n \r\n2.\r\n \r\nThe ideal length of a CV is \r\n1\r\n-\r\n2 pages\r\n \r\n\r\ns hard to imagine a CV longer than that even before the start of your \r\ncareer), so always be prudent about the use of space & choose the font and format wisely. \r\n \r\n \r\n \r\n3.\r\n \r\nAlways follow the \r\nreverse\r\n \r\nchronological order (i.e. most recent ones first) while outlinin\r\ng educational \r\nqualifications, internships/projects, work experiences etc. \r\n \r\n \r\n \r\n4.\r\n \r\nRelevance should be the mantra while writing about projects, paper presented etc. Mention only those which go \r\nalong with the objective of the CV instead of \r\neverything\r\n \r\nthat you \r\nhave done till date. \r\n \r\n \r\n \r\n5.\r\n \r\nAlways mention timeline & duration of projects/ internships along with a \r\nbrief\r\n \r\ndescription. \r\n \r\n \r\n6.\r\n \r\nAchievements: Was cricket team captain in school, participated and won dance competition in class 8\r\nth\r\n-\r\n \r\nreally? \r\nDo not \r\nmake your CV unnecessarily long by mentioning redundant information.\r\n \r\n \r\n \r\n7.\r\n \r\nRefrain \r\n\r\n\r\n \r\nlet\r\n \r\nyour achievements and experiences speak for you. \r\n \r\n \r\n8.\r\n \r\nAlways \r\navoid acronyms\r\n \r\n\r\n\r\n \r\n \r\n \r\nInternationally\r\n \r\npeople understand million, billion.\r\n \r\n \r\n.\r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\nCommon\r\n \r\nResume Mistakes\r\n \r\n \r\nFollowing is a lis\r\nt of common mistakes students make in their resumes. Have a look and see how many of these \r\nerrors (if any) your current resume contains. You may correct them now or in subsequent chapters\r\n.\r\n \r\n \r\nTip\r\n \r\n \r\nThese mistakes have been identified and listed as per what i\r\ns \r\ngenerally\r\n \r\nexpected in a professional resume in the \r\nindustry. There may be cases where you may have to follow the guidelines issued by your placement office or \r\nrecruiting company which may be contradictory to what is written here. In such situations, you \r\nhave no choice but \r\nto follow what is asked by them.\r\n \r\n \r\n \r\n \r\n1\r\n. The resume file is not named properly\r\n \r\n \r\nHave you named your resume file as \r\nresume.doc\r\n \r\nor \r\ncv.doc\r\n \r\nor something similar? This is not only unprofessional \r\nbut also makes it difficul\r\nt for a recruiter to identify your resume once he downloads and saves your resume to a \r\nfolder (Think what will happen if all the applicants\' resumes were named as \r\nresume.doc\r\n \r\ninside that folder). Correct \r\npractice to name your resume is \r\nFirst Name Last Name \r\n-\r\n \r\nCollegeName.doc\r\n. For example, if you are Rahul Rana \r\nfrom IIT Madras, you can name your resume as \r\nRahul Rana \r\n-\r\n \r\nIIT Madras.doc\r\n. Also wherever possible, always \r\nsend your resume in PDF format \r\n-\r\n \r\nlooks very professional\r\n.\r\n \r\n \r\n2. The resume runs int\r\no 2 pages or more\r\n \r\n \r\nWhile there is no set rule that your resume necessarily have to be within 1 page but more often than not students\' \r\nresumes run into multiple pages either because it contains too many irrelevant details or because the space has \r\nnot been u\r\ntilized efficiently. If your resume is more than 1.5 pages long, get your scissors ready. Remember, if \r\nSteve Jobs can mention what he did in one page, so can you!\r\n \r\n \r\n3. Resume follows a 2 column structure\r\n \r\n \r\nAt times, a few students make their resume in a 2 co\r\nlumn structure. Please don\'t. Stick to a one column structure \r\nas provided in sample resumes. Two column structures make the reading \r\nextremely\r\n \r\ndifficult for a reader as it \r\nbecomes difficult to decide which column one should focus on. Plus it is highly space\r\n \r\nin\r\n-\r\nefficient.\r\n \r\n \r\n4. Your resume contains logo of your college\r\n \r\n \r\nThere are a few colleges where Training & Placement cells make it compulsory that you put your college logo on \r\ntop of your resume\r\n \r\n-\r\n \r\nin that case you cannot help it. But otherwise, or when applying off campus, you do not need \r\nto include the logo and make your resume unnecessarily bulky. Remember, your resume is your advertisement, \r\nnot your colleges. If you have your college logo in y\r\nour resume for no reason, delete it NOW.\r\n \r\n \r\n5. Your resume contains your photograph\r\n \r\n \r\nAgain, not required, if you have it in your current resume \r\n-\r\n \r\nplease remove it. There is absolutely no need of a photo \r\nin a resume unless you are applying for a position wher\r\ne how you look matters such as aviation, hospitality, media, \r\nfilms, modeling etc. Else it is quite an outdated practice and unnecessary bulks up your resume file.\r\n \r\n \r\n \r\n.\r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n6. Your resume contains a very generic \r\nCareer Objective\r\n \r\nstatement\r\n \r\n \r\nIf you have a \r\nCareer Objective\r\n \r\nlisted in your resume, does it read something like this?\r\n \r\n \r\n\"To experience the challenges of a working engineer in a healthy but competitive environment of industry, enabling \r\nto extract the best out of me which is conducive to learn and grow as professional, thereby directing my future \r\nendeavors as an asset to the \r\norganization\"\r\n \r\n \r\nThese kind of copy pasted and generic statements serve no purpose other than making it clear to a recruiter that \r\nyou have no idea of what you want from your career. You should either have a very \r\nspecific\r\n \r\nobjective statement \r\noutlining your in\r\nterests or have none at all (yes that is OK). An example of a good \r\nObjective\r\n \r\nstatement is given \r\nbelow \r\n-\r\n \r\n \r\n\"4th year B.Tech Computer Science student at IIT Madras with excellent academic record and keen interest and \r\npractical exposure in the field of informa\r\ntion security, especially web applications security.\"\r\n \r\n \r\n7. In your resume, things are not listed in reverse chronological order\r\n \r\n \r\nLook at your Academics, or Projects, or Internships, or Co/Extra Curricular section. Does it contain information in \r\nreverse chronological \r\ni.e. most recent first order? Yes, in each section, you should mention the most recent\r\n \r\nactivity/achievement at the top and the least recent at the bottom. The reason being that employers are most \r\ninterested in what you have been upto \r\nrecently and you should make it easy for them to find out that information. If \r\nyou have written it any other way in your resume in any section, please correct it now.\r\n \r\n \r\n8. You have mentioned each year\'s/semester\'s GPA/% Marks in your Academics section.\r\n \r\n \r\nNot\r\n \r\nrequired, just mentioning aggregate marks/CGPA is enough. For example, if you have completed six \r\nsemesters of your B.Tech degree, you do not have to write each semester\'s GPA; aggregate CGPA at the end of \r\n6th semester is enough\r\n.\r\n \r\n \r\n9. You have listed all th\r\ne courses and labs that you have done till date\r\n \r\n \r\nNot required, strike that section off please. At best list 2\r\n-\r\n3 most \r\nrelevant\r\n \r\ncourses along with your grades in those \r\ncourses (if grades were good). If an employer wants to know all the courses that you have \r\ndone till date, he/she \r\nwill most probably ask for an official transcript anyway.\r\n \r\n \r\n10. You have included knowledge of \r\nWindows\r\n \r\nin your Technical Skills section\r\n \r\n \r\nPlease don\'t. It\'s like saying you know English alphabets \r\n-\r\n \r\nit\'s that common.\r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\nFAQ\r\ns\r\n \r\n \r\n \r\n \r\n1. What is the difference between a resume and a CV?\r\n \r\n \r\nWhile these terms are often used interchangeably; the key difference between a resume and a CV is length.\r\n \r\n \r\nA CV (stands for Curriculum Vitae meaning \r\ncourse of life\r\n \r\nin Latin) is a 2 or more pages (generally 3\r\n-\r\n8 pages) lo\r\nng \r\ndocument which has in\r\n-\r\ndepth details of your education, experience, achievements, awards, honors, publications \r\netc. in chronological order. A CV does not change with the internship or job you are applying to.\r\n \r\n \r\nA resume is a concise summary (not more than\r\n \r\n2 pages long) of your education, skills, or experience. It is highly \r\ncustomizable document where you, depending on the type of internship/job you are applying for, may choose to \r\nhighlight one particular aspect over another.\r\n \r\n \r\nApparently a CV is mostly used\r\n \r\nwhile applying for academic positions, research positions, fellowships, grants etc., \r\nwhile a resume is used everywhere else. What most of the students write in India is a hybrid version of a resume \r\nand a CV.\r\n \r\n \r\n2. What all should one include in a resume?\r\n \r\n \r\nO\r\nther than basic info such as name and contact details, whatever you think will help you get the interview call. The \r\nsecret lies in understanding what is it (a skill or an experience) that a particular employer is looking for and then \r\ncustomize your resume \r\nto highlight that aspect of your credentials and profile well.\r\n \r\n \r\nRead the job or internship description carefully to understand what skills does it demand and then write your \r\nresume. For example, if the role requires knowledge of Java programming while majo\r\nrity of your projects have \r\nbeen in PHP and only 1 or 2 in Java; for this role you are better off highlighting your Java projects over PHP \r\n-\r\n \r\nbecause that is what would attract the employer.\r\n \r\n \r\nRemember not to inflate your resume with irrelevant and unnecessary details.\r\n \r\n \r\n3. Does a resume necessarily have to be 1 page\r\n?\r\n \r\n \r\nIt is desirable but not mandatory (unless specifically asked for 1 page format by the organization you are applying \r\nto).\r\n \r\n \r\nThis do\r\nes not mean that you go on writing about every small school competition that you ever participated in. And \r\nhonestly, it is difficult to imagine a resume longer than 1.5 pages for a student. Remember, relevancy is the key \r\nbut do not cram your resume into 1 \r\npage if you really can\'t.\r\n \r\n \r\n4. Should one have a different resume for tech & managerial job?\r\n \r\n \r\nIdeally yes. In a technical role, focus is more on technical know\r\n-\r\nhow and hence you may want to spend more \r\nspace on your technical projects, program\r\nming skills etc. While in a managerial position, your interpersonal skills \r\nare more important (communication, ability to coordinate, lead teams etc.).\r\n \r\n \r\nProblem solving is one skill that is core to any type of role and should be given due space in resume. F\r\nor example \r\nif you have example of this great technical project which required you to solve a complex problem by breaking it \r\ndown into smaller problems; you must retain it even if you are applying to a managerial role\r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\nSample Templates\r\n \r\n \r\n1.\r\n \r\n \r\nD\r\nownload\r\n \r\nthis\r\n \r\nt\r\nemplate\r\n \r\nhere\r\n.\r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n  \r\n. \r\n \r\n \r\n \r\n \r\n \r\n2.  \r\n \r\nD\r\nownload\r\n \r\nthis\r\n \r\nt\r\nemplate\r\n \r\nhere\r\n. \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\nRecommended \r\nArticles on Resume writing\r\n \r\n \r\n \r\n \r\n  \r\n1. \r\nThe Nitty\r\n-\r\nGritty of Resume Writing\r\n \r\n \r\n \r\n2. \r\nFive Resume Blunders you should absolutely avoid\r\n \r\n  \r\n3. \r\nWhat is the difference between a CV and a resume?\r\n \r\n \r\n \r\n4. \r\nInternships: Build Your Resume. Get Hired. Earn More.\r\n \r\n  \r\n5. \r\nHow not to write an Internship CV\r\n \r\n \r\n \r\n \r\n \r\n','2019-09-24','/media/static/upload_files/Internshala_Resume_Guide_P5261GY.pdf','suraj',NULL,''),(18,'za\r\n\r\n   \r\n\r\nwelch\r\n\r\nWelch Materials India Pvt Ltd\r\n838 JMD Megapolis Sector 48\r\nSohna Road\r\n\r\nGurgaon 122018\r\n\r\nIndia\r\n\r\nGSTIN OGAABCW8227H128\r\n\r\nCIN: U74999HR2016FTCO64338\r\nPAN:AABCW8227H\r\nLUT:AD060419000830E\r\n\r\nBill To\r\n\r\nJubilant Chemsys Limited\r\nD-12, Sector-59, Noida\r\nNoida\r\n\r\n201301 Uttar pradesh\r\nIndia\r\n\r\nGSTIN 09AABC}4392G1ZF\r\n\r\nShip To\r\n\r\nD-12, Sector-59, Noida\r\n201301 Uttar pradesh\r\nIndia\r\n\r\nGSTIN O9AABCj4392G1ZF\r\n\r\nPlace Of Supply: Uttar Pradesh (09)\r\n\r\nPart\r\n\r\neae ab sen oeon)\r\n\r\nNumbe\r\na\r\n\r\nHSN/SAC.\r\n\r\nTax Invoice\r\n\r\n#WM/2019-20/234\r\n\r\nBalance Due\r\n\r\nRs.38,798.40\r\nInvoice Date\r\nTerms\r\nDue Date 20-09-\r\nP.O.\r\n\r\n \r\n\r\nAmount\r\n\r\n \r\n\r\n \r\n\r\n1 _ Nylon Syringe Filter 13mm*0. 00802- 90279090\r\n22um,100pc 02201\r\n\r\n2. PTFE Syringe Filter 13mm*0. 00802- 90279090\r\n22um, 100pcs 05201\r\n\r\n590.00 2,548.8 4,160.00\r\n0\r\n18%\r\n\r\n780,00 3,369.6 18,720.00\r\n0\r\n18%\r\n\r\nSub Total 32,880.00\r\n\r\nIGST (18%) 5,918.40\r\n\r\nTotal Rs.38,798.40\r\n\r\nBalance Due Rs.38,798.40','2019-09-24','/media/static/upload_files/TEST_wq1gIfD.jpeg','suraj',NULL,''),(19,'Suraj Prasad Gupta\r\n \r\n+91\r\n-\r\n9140097253\r\n \r\nspgupta082@gmail.com\r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\nCAREER OBJECTIVE\r\n \r\n \r\n \r\nTO work for an organization where i can prove my ability and grow with the growth of the organization \r\nand \r\nImprove my skill and realize my potential.\r\n \r\n \r\nPROFETIONAL QUALIFICATION\r\n \r\n \r\n